pragma solidity ^0.4.0;

import "./Amendable.sol";

/**
 * Generic amendment that will give us the opportunity to add data in the future
 * that we haven't already specified a field for
 */
contract Amendment is Amendable {

    string private format;
    bytes private data;

    function Amendment(string _format, bytes _data) {
        format = _format;
        data = _data;
    }

    // Restricted getters
    //-------------------

    function getFormat() external constant restricted returns (string) {
        return format;
    }

    function getData() external constant restricted returns (bytes) {
        return data;
    }
}
